(448, 'Finalizado', '2023-11-06 10:03:05', 296, 132, 'Após uma análise, constatamos uma intermitência nas redes wifi da unidade, conforme relatado pelo cliente. Após realizarmos alguns testes, conseguimos identificar que vários Access Point\'s estavam propagando sua própria rede wifi de forma independente (usuário x e y se conectavam no mesmo SSID \"Vamos Sorrir\",  mas cada um estava acessando uma rede diferente), causando um mal funcionamento da rede pelo fato de não ter uma gerência centralizada. Neste cenário, o ideal é que todos os AP\'s estejam propagando a mesma rede com apenas uma gerência para não causar conflitos. Também observou-se que uma das redes de internet da unidade não estava funcionando.\r\n\r\nComo solução, foi solicitado ao técnico Diego a disponibilização de um desktop provisório para que seja utilizado como servidor para a controladora wifi, e também a abertura de chamado com o provedor para verificar o problema da internet secundária que não funciona.\r\n\r\nSugeri também que fosse realizado o backup de um servidor sem informações que foi encontrado no CPD da unidade.', '2023-11-06 10:03:05', NULL),
