(647, 'Em Atendimento', '2023-11-20 22:09:54', 356, 132, 'Inicializado as 22:09:54 hs. do dia 20-11-2023', '2023-11-20 22:09:54', NULL),
(648, 'Finalizado', '2023-11-20 22:17:16', 356, 132, 'Conforme inserido no chamado anterior, fizemos a reconfiguração de toda a rede e estabelecemos o funcionamento das redes que estavam intermitentes. Recriamos as redes \"Vamos Sorrir\" e \"Vamos Sorrir Pacientes\", testamos em todos os andares e valdiamos o bom funcionamento com os usuários que estavam presentes na unidade.\r\n\r\nEm contato com Silvio, o problema que foi reportado pelo cliente é que uma TV no térreo não estava se conectando a rede Wifi, prontamente sugerir que a TV fosse reconfigurada, pois aparenta ser um problema isolado no equipamento. Sugiro o envio de um técnico a unidade para realize a verificação da rede e entenda melhor as dificuldades reportadas pelo cliente para que possamos atuar em cima do problema de fato.', '2023-11-20 22:17:16', NULL),
(649, 'Em Atendimento', '2023-11-21 09:35:47', 199, 131, 'Inicializado as 09:35:47 hs. do dia 21-11-2023', '2023-11-21 09:35:47', NULL),
(650, 'Em Atendimento', '2023-11-21 10:27:00', 253, 131, 'Inicializado as 10:27:00 hs. do dia 21-11-2023', '2023-11-21 10:27:00', NULL),
(651, 'Aguardando Cliente', '2023-11-21 10:35:45', 253, 131, 'A auxiliar, devido a problemas nos computadores e alta demanda, pediu para fazermos o download do sistema quando formos atender os chamados solicitados por ela. Confirmei o pedido dela e será feito ao irmos solucionar os problemas.', '2023-11-21 10:35:45', NULL),
(652, 'Em Atendimento', '2023-11-21 10:36:20', 257, 131, 'Inicializado as 10:36:20 hs. do dia 21-11-2023', '2023-11-21 10:36:20', NULL),
(653, 'Aguardando Cliente', '2023-11-21 10:44:22', 257, 131, 'Falei com a auxiliar (Rosane) para fazer a instalação do AnyDesk, primeiro ela disse que não conseguiria naquele momento, porque estava sozinha na recepção. Após aguardar alguns dias, entrei em contato com ela novamente,  retornou me dizendo que estava em horário de almoço. Retornei novamente para ela, agora diz que não vai conseguir fazer a instalação pois está acumulada de trabalho, não tendo tempo para parar e fazer o procedimento, pediu para algum técnico ir até o local para fazer a instalação.', '2023-11-21 10:44:22', NULL),
(654, 'Em Atendimento', '2023-11-21 10:45:14', 236, 131, 'Inicializado as 10:45:14 hs. do dia 21-11-2023', '2023-11-21 10:45:14', NULL),
(655, 'Aguardando Cliente', '2023-11-21 10:48:15', 236, 131, 'Auxiliar Patrícia informou que foi feito um chamado relacionado a algumas máquinas que não estão funcionando e pediu a instalação do AnyDesk ao irmos resolver os problemas das máquinas. Confirmei o pedido dela e será realizado durante a visita.', '2023-11-21 10:48:15', NULL);
