(678, 'Reprovado', '2023-11-22 10:44:53', 350, 132, 'Para resolver os problemas da rede foi necessário configurar um outro equipamento, um roteador TP Link, de forma provisória para evitar indisponibilizar a rede por um longo período de tempo, fazendo uma mudança de forma transparente para os usuários.\r\n\r\nSendo assim, configuramos e implementamos o roteador TP Link, pois não conseguimos acessar o roteador EdgeRouterX que estava em funcionamento devido ao erro de usuário e senha. O roteador TP Link foi colocado de forma provisória, devido algumas limitações do mesmo.\r\n\r\nEm acordo com o técnico Diego, retirei o roteador EdgeRouterX para reset de fábrica, configuração e após isso substituir o equipamento provisório, até que possa ser implementado o roteador Mikrotik, sugerido anteriormente.\r\n', '2023-11-22 10:44:53', NULL),
