(704, 'Finalizado', '2023-11-24 12:38:49', 352, 131, ' Ao chegar no consultório o qual computador não estava apresentando o Windows, identifiquei o problema - mau contato da SATA- . A placa não estava reconhecendo o HD, apresentando a BIOS amiúde. Realizei a troca da SATA e funcionou normalmente. De antemão, já visualizei lentidão (HD e Memória) no desempenho da máquina, fiz algumas otimizações, mas será necessário pedir as peças.', '2023-11-24 12:38:49', NULL),
(705, 'Em Atendimento', '2023-11-24 15:31:41', 364, 14, 'Inicializado as 15:31:41 hs. do dia 24-11-2023', '2023-11-24 15:31:41', NULL),
