(745, 'Em Atendimento', '2023-11-29 19:12:22', 164, 131, 'Inicializado as 19:12:22 hs. do dia 29-11-2023', '2023-11-29 19:12:22', NULL),
(746, 'Finalizado', '2023-11-29 19:15:17', 164, 131, 'Ao abrir um gabinete do computador, foi notado que a ventoinha não estava recebendo energia, permanecendo inerte, isso fazia com que a placa aquecesse e desligasse durante um período de tempo. Será solicitado uma ventoinha nova para o computador. Por enquanto, foi feito a substituição dele por uma nova que estava em um outro computador que estava inutilizado. Assim que a peça chegar será feito a troca adequada.', '2023-11-29 19:15:17', NULL),
(747, 'Em Atendimento', '2023-11-29 19:15:56', 163, 131, 'Inicializado as 19:15:56 hs. do dia 29-11-2023', '2023-11-29 19:15:56', NULL),
(748, 'Finalizado', '2023-11-29 19:18:07', 163, 131, 'O problema é o gabinete, pois o botão de liga/desliga se encontra danificado. Ele não dá acesso ao mecanismo de liga/desliga para tentar uma ratificação. Terá que ser solicitado um novo gabinete para resolver o problema e será solicitado.', '2023-11-29 19:18:07', NULL),
(749, 'Em Atendimento', '2023-11-29 19:21:29', 361, 131, 'Inicializado as 19:21:29 hs. do dia 29-11-2023', '2023-11-29 19:21:29', NULL),
(750, 'Finalizado', '2023-11-29 19:23:32', 361, 131, 'Ao analisar o problema, foi notado que o sistema está usando o limite da memória RAM, causando travamentos do sistema, sendo necessário acrescentar mais memória ou comprar um pente de memória com maior GB. O pedido será encaminhando.\r\nSituação passada para a auxiliar.', '2023-11-29 19:23:32', NULL),
(751, 'Finalizado', '2023-11-29 19:30:48', 341, 131, 'Foi feito a troca do SSD, limpeza da memória RAM, limpeza da ventoinha e troca da fonte, contudo, o problema persiste, visando isso, tudo indica que é a placa-mãe pode está danificada. Será feito um pedido de uma nova placa-mãe.', '2023-11-29 19:30:48', NULL),
(752, 'Em Atendimento', '2023-11-29 19:34:15', 370, 131, 'Inicializado as 19:34:15 hs. do dia 29-11-2023', '2023-11-29 19:34:15', NULL),
(753, 'Finalizado', '2023-11-29 19:40:18', 370, 131, 'Quando cheguei no local, a auxiliar disse que o problema já tinha sido resolvido e que estava tudo normalizado. Entretanto, pediu para que eu visse um outro computador que estava com o mesmo problema do qual está no chamado, fiz as análises e vi que o gabinete se encontrava sujo, realizei a limpeza dele e da memória, fiz alguns testes de fonte, verifiquei a pasta térmica, limpeza na ventoinha, conexão dos fios. Após fazer todo esse procedimento, o computador voltou a funcionar normalmente. Além disso, fiz a limpeza dos caches, nos computadores na clínica e verifiquei se o AnyDesk estava baixado nas máquinas, como não estavam, assim foi feito a instalação dele. Computador do consultório 08 estava reiniciando sozinho, refiz o procedimento mencionado no início do relatório e ele voltou a funcionar novamente.', '2023-11-29 19:40:18', NULL),
