(766, 'Pausado', '2023-12-01 08:13:06', 184, 15, 'Iniciamos o processo de portabilidade. (PRÉ AGENDADO) A conclusão está prevista para o dia 04/12/2023 as 20h\r\nInstalação será realizada da nova linha Voip no dia 05/12/2023.', '2023-12-01 08:13:06', NULL),
