(827, 'Finalizado', '2023-12-15 11:32:53', 385, 131, 'Foi feito um atendimento remoto. Visando o problema, pedi para que ela tentasse ligar o computador com ele conetado direto na tomada, uma vez que ele estava conectado ao estabilizador. Ao conectar a máquina na tomada, ela funcionou normalmente. Pedi para ela fazer alguns testes com o estabilizador, retirando e conectando novamente da tomada e tentando ligar, mas o aparelho não ligava. Todas as explicações do problema foram passadas para a auxiliar (Kátyla) e ela está ciente.\r\n\r\nConclusão: Estabilizador queimou, terá que solicitar um novo.', '2023-12-15 11:32:53', NULL),
(828, 'Em Atendimento', '2023-12-15 12:44:41', 386, 131, 'Inicializado as 12:44:41 hs. do dia 15-12-2023', '2023-12-15 12:44:41', NULL),
(829, 'Finalizado', '2023-12-15 12:47:06', 386, 131, 'Foi passado algumas orientações para a auxiliar, com relação as máquinas lentas. Pedi para que ela acessar o gerenciador de tarefas e mostrasse as informações apresentadas. Finalizando esse processo, será necessário memórias e SSD. \r\nFoi verificado, também, o tipo de memória que será solicitado.\r\nPedido será feito em breve.', '2023-12-15 12:47:06', NULL),
