(851, 'Finalizado', '2023-12-18 16:06:25', 409, 131, 'Fiz uma análise geral no computador, executando a limpeza da ventoinha, memória RAM e placa-mãe. Observei que a pasta térmica do processador estava super ressecada, na verdade, quase não tinha pasta direito. Foi colocado uma nova pasta térmica e a fixação da ventoinha na placa. Esperei alguns instantes e deixei em observação. Após voltar ao consultório, o doutor validou. \r\nConcluída.', '2023-12-18 16:06:25', NULL),
(852, 'Finalizado', '2023-12-18 16:10:33', 410, 131, 'Foi um feito a estudo da memória e do disco, como de costume, após isso, foi perceptível que a memória estava pouco para a quantidade de execuções que eram feitas (E não eram muitas), a memória estava 2,0/3,9, quando não estava executando alguns programas, quando executando, estava batendo 2,7/3,9. Precisa-se de uma memória de 8 GB (Notebook/DDr3) para suprir a necessidade da máquina.\r\nFoi feita uma substituição da máquina até a chegada da memória nova, essa troca não interferiu as atividades da doutora.\r\n\r\nConcluída.', '2023-12-18 16:10:33', NULL),
(853, 'Pausado', '2023-12-18 16:12:11', 403, 131, 'Feito a instalação da fonte. SSD era para o COSB IX, cujo instalação foi feita.', '2023-12-18 16:12:11', NULL),
