(856, 'Finalizado', '2023-12-18 16:56:40', 334, 14, 'Impressora está instalada e imprimindo.\r\nImpressão saindo falhado porque está com o tonner vazio .\r\nNecessário a troca do tonner', '2023-12-18 16:56:40', NULL),
