(1010, 'Finalizado', '2024-01-08 10:03:52', 456, 131, 'Foi feito a troca do botão que liga a máquina, uma vez que o padronizado estava danificado. Após isso, só liguei a máquina e ela funcionou normalmente.', '2024-01-08 10:03:52', NULL),
