(1049, 'Finalizado', '2024-01-10 12:23:03', 402, 131, 'Quando cheguei na unidade fui informado que não havia problema relacionado aos computadores. Um Doutor sinalizou-me que a máquina em questão ficava reiniciando, aparentemente. Aguardei alguns intantes até que o Consultório ficasse livre, porém, havia muitos atendimentos, dos instantes em que fiquei, não recebi queixas sobre máquina reiniciando. Logo, entrei em contato com a auxiliar sobre, ela mencionou que não ficou sabendo sobre computadores com defeito, desse modo chegamos ao acordo de que, devida a alta demanda na unidade e a necessidade minha de ir para outras, se houvesse qualquer problema, ela abriria chamado e eu retornaria.', '2024-01-10 12:23:03', NULL),
