(1119, 'Finalizado', '2024-01-18 10:16:06', 475, 131, 'Ao chegar na unidade de Lauro de Freitas, foi relatado sobre quatro máquinas.\r\nDuas na recepção, uma na Prótese e uma na recepção da Orto (Recepção do segundo andar).\r\n\r\nOs dois problemas da recepção se tratava de Windows corrompido, foi pedido uma autorização de formatação para a auxiliar substituta e ela autorizou, dizendo que não havia problema algum em formatar ambos computadores.\r\nAssim, foi feita a formatação e os computadores ficaram funcionando normalmente, baixei todos os programas necessários como Office, Ecuro, Impressora, Chrome, etc. Vale ressaltar que a formatação foi autorizada pela auxiliar substituta. Única pendência que ficou foi o cadastro dos hamster, como a auxiliar havia ido para casa, deixei recado com as meninas da recepção.\r\nConcomitante a todo esse procedimento, foi feita uma checagem com relação ao computador da Prótese que estava com a fonte queimada, como eu tinha uma fonte na mochila, eu substituí a queimada pela nova e deixei o computador funcionando normalmente.\r\nO computador que estava na recepção de baixo, substituindo o computador que estava com problema foi pedido para subir para recepção da Orto, assim foi feito. Ao total, ficaram 4 computadores funcionando na Recepção da Orto, 3 computadores funcionando na recepção principal e o computador da Prótese.\r\nVale ressaltar que quando cheguei lá na unidade, a auxiliar substituta não havia comprado a fonte, questionei sobre e ela disse para que eu visse tudo que iria precisar, pois compraria tudo de vez.\r\nEntão, deu o horário, a auxiliar tinha ido embora, eu ajeitei todos os computadores, fiz as mudanças que ela solicitou e finalizei o atendimento.', '2024-01-18 10:16:06', NULL),
(1120, 'Em Atendimento', '2024-01-18 10:16:49', 486, 131, 'Inicializado as 10:16:49 hs. do dia 18-01-2024', '2024-01-18 10:16:49', NULL),
