(1161, 'Finalizado', '2024-01-22 14:01:44', 507, 131, 'CAJAZEIRAS XI\r\n\r\nQuando cheguei na unidade, o Dr.Daniel não se encontrava. Então, perguntei às meninas da recepção sobre os problemas dos computadores, duas me informaram problemas distintos, uma dizia que o computador estava lento e a outra dizia que o computador, ao ligar, aparecia uma tela azul e ela precisava ficar pressionando a tecla Enter para sair da tela. Para essa, foi feita uma limpeza de arquivos temporários e uma otimização do disco rígido, para esta foi feito um reparo do Windows para sanar o problema.\r\n\r\nApós a conclusão das atividades, um rapaz chamado Nilson/Nilton, informou-me de um computador que estava com problema na biometria, acompanhei-o até o consultório onde ele apresentou-me o problema, rapidamente percebi que se tratava do cadastro do leitor biométrico no site do Ecuro, passei a solução para ele e concluímos o atendimento.\r\nEnquanto fechava o atendimento, ele pediu para que eu desse uma olhada na biometria da recepção que estava ruim também (Vale ressaltar que a biometria primária que estou me referindo é do consultório orto 04/03), fui até a recepção e resolvi o problema: aplicativo do Ecuro não estava inicializando, consequentemente a biometria não pedia acesso.\r\nFeito isso, realizei o fechamento do atendimento.\r\nVale ressaltar que não foi passado problema com o uso da internet, apenas o sistema lento, então, procurei saber sobre esse problema, para evitar problemas futuros e fui informado que já foi resolvido.\r\nEstando tudo dentro dos conformes, peguei minhas coisas e fui em boa hora.', '2024-01-22 14:01:44', NULL),
(1162, 'Finalizado', '2024-01-22 14:54:09', 511, 131, 'Computador Consultório 6 -\r\n\r\nJá havia feito algumas visitas nesse consultório para resolver a situação do computador reiniciando diariamente, é necessário adquirir uma fonte nova, uma vez que as modificações realizadas foram de RAM, Pasta Térmica e Limpeza.\r\n\r\nConclusão: Será necessário a compra de uma \r\nfonte nova\r\n\r\nA auxiliar efetuou a compra e o computador está funcionando, acrescentei mais uma memória RAM que estava na mochila.', '2024-01-22 14:54:09', NULL),
(1163, 'Finalizado', '2024-01-22 14:56:12', 512, 131, 'Computador do Consultório 4 -\r\n\r\nO problema informa que está sem internet, porém, estava sem antena de wi-fi, sem antena não tem internet.\r\n\r\n*Conclusão: Comprar uma antena nova.*\r\n\r\nDeixei sobre minha responsabilidade o pedido de 4 antenas de melhor qualidade para a unidade, as antenas que possuem não recebe o sinal com tanta precisão.', '2024-01-22 14:56:12', NULL),
(1164, 'Finalizado', '2024-01-22 14:58:12', 513, 131, 'Computador Consultório 5 -\r\n\r\nFoi conversado com o doutor da sala e ele informou que o problema era, apenas, a antena wifi, ele adquiriu uma e resolveu.\r\n\r\nVale ressaltar que nenhum computador foi deixado sem antena Wi-Fi, apenas um que já estava sem antena, os demais foram deixado antenas por enquanto, até as antenas novas chegarem.', '2024-01-22 14:58:12', NULL),
