(1200, 'Finalizado', '2024-01-24 07:20:06', 498, 131, 'Problema com a memória RAM, placa estava suja. Foi passado limpa contato nela e limpeza na RAM, quando iniciei o computador funcionou normalmente.', '2024-01-24 07:20:06', NULL),
(1201, 'Finalizado', '2024-01-24 07:27:09', 502, 131, 'Foi feito a troca da pasta térmica do computador, uma vez que a CPU estava atingindo 100%, para ver se sanava o problema. Pós o procedimento, a CPU estava normalizada, porém, é necessário ficar em observação, pois esse problema pode ser do próprio processado e não da falta de pasta térmica.', '2024-01-24 07:27:09', NULL),
(1202, 'Finalizado', '2024-01-24 07:28:18', 501, 131, 'Quando fui analisar o computador, ele não ligava mais. Fonte danificada, logo, não consegui ver a situação dele com relação a lentidão. Necessário a compra de uma fonte nova.', '2024-01-24 07:28:18', NULL),
