(1221, 'Finalizado', '2024-01-24 21:18:35', 460, 131, 'O chamado relata três computadores sem funcionar.\r\nO primeiro computador está com a fonte queimada, necessário comprar uma nova para instalação.\r\nO segundo computador ligava, mas estava com problema na hora de dar vídeo. Foi feito uma limpeza na memória RAM e o problema foi sanado.\r\nO terceiro computador estava funcionando tranquilamente.\r\nFoi feito a instalação das memórias em dois computadores da recepção e um na prótese. Sobrou uma memória, acredito eu que foi de algum computador que não está mais utilizando, pois os doutores estavam usando notebook\'s para fazer atendimento.\r\nComputador do Consultório 09, precisará de memória RAM, e o computador do Consultório 15/16 também. Consultório 03 precisa de SSD e memória 8GB.', '2024-01-24 21:18:35', NULL),
