(1246, 'Finalizado', '2024-01-26 11:33:43', 490, 131, 'Foram feitas as instalações das peças (memórias ram\'s e ssd) nos computadores da recepção, como foi solicitado. Computadores dos consulórios 01 ; 16 e 09, também foram feitos análises.\r\nComputador 01 foi formatado;\r\nComputador 16, apresentava problema na biometria, portanto foi orientado a auxiliar abrir chamado no MovieDesk.\r\nComputador 09, apresentava problema no cabo de força, solicitei um novo a auxiliar e ela conseguiu.\r\nOs chamados com relação a esses computadores foram pedidos para serem abertos.', '2024-01-26 11:33:43', NULL),
