(1265, 'Finalizado', '2024-01-29 13:36:20', 473, 14, 'Consultório de prótese: Computador estava desligado, faltando os cabos de alimentação do monitor e da cpu. Colocado os cabos e feito a atualização do sistema e melhoria de desempenho.\r\n\r\nConsultório 05: Montagem e troca do cabo de força que estava com defeito. Mouse não funcionava devido falta de bateria.\r\n\r\nConsultório 02: Navegador de internet estava fechando sozinho. Reinstalação do navegador e problema foi resolvido. \r\n\r\nConsultório 04: Montagem do computador que estava instalado na recepção. \r\n\r\n\r\n', '2024-01-29 13:36:20', NULL),
(1266, 'Em Atendimento', '2024-01-29 15:38:48', 538, 131, 'Inicializado as 15:38:48 hs. do dia 29-01-2024', '2024-01-29 15:38:48', NULL),
