(1269, 'Finalizado', '2024-01-29 15:58:57', 523, 131, 'Computador entrando na BIOS, foi verificado o cabo SATA e o problema persistiu, porém, quando foi feito a análise do SSD, ele apresentava zerado, ou seja, SSD corrompeu. Necessário adquirir um novo.', '2024-01-29 15:58:57', NULL),
(1270, 'Finalizado', '2024-01-29 17:48:04', 537, 131, 'A ventoinha do computador não estava funcionando, isso gerava um aquecimento da máquina fazendo com que ela desligue. Foi passado limpa contato na ventoinha para soltar a hélice e algumas estimulações para que passe a girar. Feito isso, ela foi colocada na placa-mãe, onde recebeu energia da fonte e foi pegando potência para girar. Devido a exposição frequente, a ventoinha voltou a girar e funcionar normalmente, fiquei a observar o comportamento dela e o computador que se mantiveram uniforme desde sua inicialização.', '2024-01-29 17:48:04', NULL),
(1271, 'Finalizado', '2024-01-29 17:50:49', 538, 131, 'A máquina da doutora está escassa de memória RAM e necessita de um SSD. Acredito que o fato da máquina está desligando sozinha é devido a sobrecarga que ambas as peças têm sofrido, para que o problema seja retificado, é necessário a aquisição das pessoas mencionadas anteriormente.', '2024-01-29 17:50:49', NULL),
(1272, 'Finalizado', '2024-01-29 17:55:12', 520, 131, 'O aplicativo utilizado para escanear apresenta um problema em seu download, uma vez que o programa vem incompleto. Foi tentado diversas maneiras para solucionar o problema e nada deu certo. Portanto, foi feito a instalação de um aplicativo similar ao antigo do próprio sistema Windows para substituí-lo.', '2024-01-29 17:55:12', NULL),
