(1277, 'Finalizado', '2024-01-30 17:30:57', 220, 131, 'Foi realizado as instalações das peças na máquina da recepção 1, como diz o chamado e a instalação do Windows e Pacote offices, além de aplicativos que a recepção irá usar', '2024-01-30 17:30:57', NULL),
(1278, 'Finalizado', '2024-01-30 17:32:23', 464, 131, 'SSD vazio, foi necessário a instalação de um Sistema Operacional, procedimento esse que foi feito e, assim, normalizando o funcionamento da máquina.', '2024-01-30 17:32:23', NULL),
(1279, 'Finalizado', '2024-01-30 20:34:42', 465, 131, 'O problema estava na memória RAM, ela estava danificada e, por isso, não exibia imagem no monitor. Foi adicionado uma memória para substituir a antiga e o computador retornou a funcionar.', '2024-01-30 20:34:42', NULL),
(1280, 'Finalizado', '2024-01-30 20:38:04', 508, 131, 'Ao passar no consultório, não vi problema com a máquina, ela estava funcionando normal e o problema dela não foi mencionado, entretanto, houve a necessidade de ir aos consultórios 11; 12 e 14.\r\nFoi pedido para que a auxiliar abra um chamado relacionado as máquinas.', '2024-01-30 20:38:04', NULL),
