(1357, 'Finalizado', '2024-02-05 11:29:31', 564, 131, 'Foi feito a ativação permanente do pacote office.\r\nHouve a solicitação de retirar um SSD de uma máquina que estava inutilizável e instalar no computador da Avaliação 02. O procedimento foi feito e finalizado com sucesso.', '2024-02-05 11:29:31', NULL),
(1358, 'Finalizado', '2024-02-05 11:31:38', 565, 131, 'Foi retirado o cabo de rede do roteador, aguardando alguns instantes e reconectado, com o tempo a internet retornou. Ativação do Windows 7 também foi feito para melhor funcionamento do S.O.', '2024-02-05 11:31:38', NULL),
(1359, 'Em Atendimento', '2024-02-05 12:45:47', 541, 131, 'Inicializado as 12:45:47 hs. do dia 05-02-2024', '2024-02-05 12:45:47', NULL),
(1360, 'Finalizado', '2024-02-05 14:44:49', 541, 131, 'Quando cheguei fui orientado a resolver a situação da Prótese, como diz no chamado: prótese não está funcionando na internet.\r\nFoi feita uma varredura geral do problema e cheguei a conclusão de que o sistema do Windows 7, fica oscilando com a conexão da internet, uma vez que testado em outras situações, a internet funcionava. Para solucionar o problema, conectei uma antena wi-fi para suprir a necessidade da Prótese. Fiz o testes e a internet estava funcionando normalmente via wi-fi. A melhor solução seria atualizar o S.O, porém existe um programa de extrema importância que só tem versão para o Windows 7. A informação foi passada para a auxiliar e ela compreendeu.\r\nÚltimo pedido foi a orientação em relação à biometria, foi orientado a abertura do chamado para que o cadastro da biometria seja feito no Ecuro.\r\nFinalizando o atendimento, a auxiliar disse-me que estava tudo certo.', '2024-02-05 14:44:49', NULL),
(1361, 'Em Atendimento', '2024-02-06 09:16:55', 567, 131, 'Inicializado as 09:16:55 hs. do dia 06-02-2024', '2024-02-06 09:16:55', NULL),
(1362, 'Em Atendimento', '2024-02-06 09:16:58', 569, 131, 'Inicializado as 09:16:58 hs. do dia 06-02-2024', '2024-02-06 09:16:58', NULL),
(1363, 'Em Atendimento', '2024-02-06 09:17:00', 568, 131, 'Inicializado as 09:17:00 hs. do dia 06-02-2024', '2024-02-06 09:17:00', NULL),
(1364, 'Finalizado', '2024-02-06 09:45:07', 568, 131, 'O computador estava entrando na BIOS. Foi necessário selecionar o Windows Boot Manager para que o S.O fosse inicializado, após isso o problema foi retificado.', '2024-02-06 09:45:07', NULL),
(1365, 'Finalizado', '2024-02-06 10:52:53', 569, 131, 'O problema não se tratava de computador desligando. O teclado estava travando e não correspondia aos comandos por falta de aterramento, por isso, ao colocar o computador no chão, o teclado voltou a funcionar. Devido a troca de computador, será necessário adquirir mais uma memória RAM, uma vez que o computador que está sendo utilizado atualmente não possui a quantidade necessária de memória para melhor desempenho.', '2024-02-06 10:52:53', NULL),
