(1386, 'Em Atendimento', '2024-02-09 09:07:51', 572, 131, 'Inicializado as 09:07:51 hs. do dia 09-02-2024', '2024-02-09 09:07:51', NULL),
(1387, 'Finalizado', '2024-02-09 11:47:04', 566, 131, 'O computador de Periperi não estava acessando o Ecuro, porém, quando cheguei ele já estava funcionando normalmente. \r\nDevido a problemas com o SSD: ele apresentava picos de reconhecimento do Windows e depois parava, pedindo para selecionar um device boot. Fiz a restauração do Windows e reinstalei os seguintes programas que foram perdidos:\r\nAny Desk;\r\nOffice;\r\nChrome;\r\nTeam Viewer.\r\n\r\nOs arquivos do doutor permaneceram na máquina. O computador do doutor sobrecarregava devido a baixa memória e alto consumo de programas, sendo assim, foi necessário colocar uma memória na máquina com maior GB, após isso, o computador funcionou normalmente. OBS: a memória que foi utilizada foi a memória de teste. Necessário repôr.', '2024-02-09 11:47:04', NULL),
(1388, 'Finalizado', '2024-02-09 11:49:57', 574, 131, 'Impressora conectada com sucesso. Problema de conexão foi o cabo de rede que estava sob tensão e isso desconectava o cabo de rede fazendo com que a impressora perdesse o endereçamento de IP.', '2024-02-09 11:49:57', NULL),
(1389, 'Finalizado', '2024-02-09 11:53:18', 575, 131, 'Foi necessário reinstalar o S.O. Com a aprovação da auxiliar, o procedimento foi feito, junto com a instalação dos programas básicos de uso, como:\r\nEcuro; AnyDesk; TeamViewer; Office; Chrome; Adobe PDF e o WinRAR.\r\nAo final foi solicitado a abertura do chamado no MovieDesk para cadastrar o leitor biométrico.', '2024-02-09 11:53:18', NULL),
(1390, 'Finalizado', '2024-02-09 11:54:32', 576, 131, 'A máquina não estava no local quando cheguei, portanto o atendimento não foi realizado.', '2024-02-09 11:54:32', NULL),
(1391, 'Em Atendimento', '2024-02-14 13:25:52', 577, 131, 'Inicializado as 13:25:52 hs. do dia 14-02-2024', '2024-02-14 13:25:52', NULL),
(1392, 'Finalizado', '2024-02-14 13:28:01', 584, 131, 'Foi feito a reinstalação do leitor biométrico, o que gerou um novo código no programa do Ecuro Finger. Assim, foi passado para a auxiliar abrir um chamado no MovieDesk para que o novo código seja cadastrado.', '2024-02-14 13:28:01', NULL),
(1393, 'Em Atendimento', '2024-02-14 13:36:18', 584, 131, 'Inicializado as 13:36:18 hs. do dia 14-02-2024', '2024-02-14 13:36:18', NULL),
(1394, 'Finalizado', '2024-02-14 13:37:19', 585, 131, 'Impressora de nota fiscal foi retirada da prótese para ser colocada na recepção. Foi feito a retirada, instalação e testes. Funcionando normalmente.', '2024-02-14 13:37:19', NULL),
(1395, 'Em Atendimento', '2024-02-14 13:37:29', 585, 131, 'Inicializado as 13:37:29 hs. do dia 14-02-2024', '2024-02-14 13:37:29', NULL),
(1396, 'Finalizado', '2024-02-14 13:39:22', 577, 131, 'Como havia trocado o leitor de local, o código gerado estava cadastrado com outro nome do Ecuro, o que deveria ser Recepção 1 estava como Consultório 5, mas o leitor estava funcionando. Foi repassado para a auxiliar que se quisesse trocar o nome do leitor deveria entrar em contato com o pessoal do MovieDesk, por vontade própria, ela decidiu deixar da maneira que está e sinalizou ao usuário da recepção 1 que o nome do leitor seria consultório 5.', '2024-02-14 13:39:22', NULL),
(1397, 'Em Atendimento', '2024-02-14 13:39:33', 577, 131, 'Inicializado as 13:39:33 hs. do dia 14-02-2024', '2024-02-14 13:39:33', NULL),
(1398, 'Finalizado', '2024-02-14 14:01:27', 582, 131, 'De primeiro momento foi feito a coleta de informação sobre o que o técnico da panorâmica sinalizou sobre o problema. A doutora não soube dizer direito o que foi repassado, então, fiz alguns testes para saber o que estava ocorrendo. A Doutora relatou que o processo da Tele 3D pedia para finalizar o procedimento quando a barra estava cheia e agora pede quando a barra estava pela metade. Para resolver melhor o problema, pedi o número do técnico da panorâmica para que a informação seja passada da melhor maneira.\r\n\r\nOBS.: Era necessário colocar o chamado em Aguardando Cliente, mas cliquei em Finalizar. Será solicitado a abertura do chamado novamente para que novas informações seja adicionada ao decorrer do atendimento.', '2024-02-14 14:01:27', NULL),
(1399, 'Em Atendimento', '2024-02-14 14:12:41', 570, 131, 'Inicializado as 14:12:41 hs. do dia 14-02-2024', '2024-02-14 14:12:41', NULL),
(1400, 'Finalizado', '2024-02-14 14:12:59', 570, 131, 'Foi feito o acesso remoto e o aplicativo foi retirado com sucesso.', '2024-02-14 14:12:59', NULL),
(1401, 'Em Atendimento', '2024-02-14 16:10:38', 581, 131, 'Inicializado as 16:10:38 hs. do dia 14-02-2024', '2024-02-14 16:10:38', NULL),
(1402, 'Pausado', '2024-02-14 16:11:26', 581, 131, 'Será feita uma conversa com Diego para colocarmos uma internet melhor e sanar esse problema.', '2024-02-14 16:11:26', NULL);
INSERT INTO `adms_cham_hist` (`id`, `status`, `dt_status`, `cham_id`, `usr_id`, `obs`, `created`, `modified`) VALUES
(1403, 'Em Atendimento', '2024-02-14 16:11:39', 581, 131, 'Inicializado as 16:11:39 hs. do dia 14-02-2024', '2024-02-14 16:11:39', NULL),
(1404, 'Pausado', '2024-02-14 16:12:37', 580, 131, 'Foi feito diversas visitas com relação a esse problema e ele sempre retornar. Recomendo adquirir um kit upgrade, pois pode ser problema na placa, ou trocar o computador.\r\nInformação será repassada para o Comercial.', '2024-02-14 16:12:37', NULL),
(1405, 'Em Atendimento', '2024-02-14 16:13:20', 579, 131, 'Inicializado as 16:13:20 hs. do dia 14-02-2024', '2024-02-14 16:13:20', NULL),
(1406, 'Pausado', '2024-02-14 16:14:28', 579, 131, 'Foi passado para a auxiliar que não fornecemos leitores biométricos, ela repassou para mim que era para falar com Priscilla. Procedimento foi passado para o Comercial que entrará em contato com ela.', '2024-02-14 16:14:28', NULL),
(1407, 'Em Atendimento', '2024-02-15 09:15:16', 586, 131, 'Inicializado as 09:15:16 hs. do dia 15-02-2024', '2024-02-15 09:15:16', NULL),
(1408, 'Finalizado', '2024-02-15 10:06:50', 586, 131, 'Foi feita a troca do gabinete, uma vez que o anterior estava danificado.', '2024-02-15 10:06:50', NULL),
(1409, 'Em Atendimento', '2024-02-15 14:10:16', 588, 131, 'Inicializado as 14:10:16 hs. do dia 15-02-2024', '2024-02-15 14:10:16', NULL),
(1410, 'Em Atendimento', '2024-02-15 14:31:35', 583, 131, 'Inicializado as 14:31:35 hs. do dia 15-02-2024', '2024-02-15 14:31:35', NULL),
(1411, 'Pausado', '2024-02-16 08:36:46', 572, 131, 'Foi feito a análise do computador da paronâmica, sendo necessário adquirir uma memória RAM de 8GB e um SSD de 240GB para melhor desempenho da máquina.', '2024-02-16 08:36:46', NULL),
(1412, 'Em Atendimento', '2024-02-16 08:38:44', 589, 15, 'Inicializado as 08:38:44 hs. do dia 16-02-2024', '2024-02-16 08:38:44', NULL),
(1413, 'Aguardando Comercial', '2024-02-16 08:39:38', 589, 15, 'Primeira Visita já foi Realizada por Diego  porém o problema persiste, Gentileza solicitar a Ans uma visita para Correção do problema.', '2024-02-16 08:39:38', NULL),
(1414, 'Finalizado', '2024-02-16 08:44:12', 567, 131, 'Ao chegar no Consultório 04, o real problema se tratava da internet e não do computador que fica desligando.\r\nA doutora sinalizou instabilidade de rede ao acessar o Ecuro e de lentidão na máquina, foi realizado uma limpeza da cache e otimização do SSD, além de desabilidar alguns programas que estavam programados para iniciar automaticamente.\r\nApós o procedimento, a doutora validou o processo e o computador funcionou de maneira mais fugaz. Sobre a internet, foi feita a troca da porta USB, assim, estabilizando.', '2024-02-16 08:44:12', NULL),
(1415, 'Pausado', '2024-02-16 08:45:50', 588, 131, 'Foi solicitado a troca do computador concuminante a troca da linha telefônica. Aguardando retorno do parceiro para dar início ao processo de troca.', '2024-02-16 08:45:50', NULL),
(1416, 'Em Atendimento', '2024-02-16 10:21:31', 578, 15, 'Inicializado as 10:21:31 hs. do dia 16-02-2024', '2024-02-16 10:21:31', NULL),
(1417, 'Em Atendimento', '2024-02-16 10:21:54', 587, 131, 'Inicializado as 10:21:54 hs. do dia 16-02-2024', '2024-02-16 10:21:54', NULL),
(1418, 'Aguardando Comercial', '2024-02-16 10:22:18', 578, 15, 'Será Necessário uma avaliação Presencial, Visita será agendada pelo comercial.', '2024-02-16 10:22:18', NULL),
(1419, 'Pausado', '2024-02-16 10:22:24', 587, 131, 'Aguardando retorno da auxiliar para saber se o problemas persiste ou já foi sanado.', '2024-02-16 10:22:24', NULL),
(1420, 'Finalizado', '2024-02-16 10:31:29', 561, 131, 'Como solicitado, foi feito um levantamento geral das peças necessárias para melhor desempenho das máquinas na unidade de São Cristóvão, a conclusão, pós as análises foram:\r\n      Computador 01 da recepção 01 - Precisa de Memória 8GB de notebook DDR3\r\n      Computador 04 da recepção 01 - Precisa de Memória 8GB normal.\r\n      Computador 03 da recepção 01 - Precisa de Memória 8GB de notebook.\r\n      Computador da Prótese - Precisa de Memória 8GB de notebook.\r\n      Consultório 10 - Possui duas máquinas paradas, peças necessárias para colocar para funcionar: Fonte ATX Bivolts;            duas  memórias RAM de 8GB de notebook.\r\n      Consultório 12 - Precisa de memória 8GB de notebook.\r\n      Computador do Consultório 05 - Precisa de SSD e Memória RAM de notebook DDR3 8GB.\r\n      1 Kit Upgrade para Computador 02 da recepção 01. Justificativa: Processador defasado.', '2024-02-16 10:31:29', NULL),
