(1454, 'Finalizado', '2024-02-19 13:48:38', 599, 131, 'O computador ligava, mas não dava vídeo. Feito limpeza na memória RAM, após isso, o problema foi retificado.', '2024-02-19 13:48:38', NULL),
(1455, 'Finalizado', '2024-02-19 13:51:17', 598, 131, 'O cabo estava com mau-contato na tomada e estava desconectado do Nobreak. Fiz a conexão com ele e testei a fonte, foi feito uma limpeza geral, após todo o procedimento o computador voltou a funcionar. A doutora estava tentando ligar pelo botão errado, instruí-a ligar do modo correto.', '2024-02-19 13:51:17', NULL),
(1456, 'Finalizado', '2024-02-19 13:54:05', 600, 131, 'Quando cheguei o problema já havia sido retificado.', '2024-02-19 13:54:05', NULL),
