(1470, 'Em Atendimento', '2024-02-23 11:47:57', 605, 14, 'Inicializado as 11:47:57 hs. do dia 23-02-2024', '2024-02-23 11:47:57', NULL),
(1471, 'Finalizado', '2024-02-23 11:53:28', 609, 131, 'O problema era devido a sujeito no cooler que dificultava a rotação dele, fazendo com que a máquina aquecesse. Após a limpeza, o computador voltou a funcionar normalmente.', '2024-02-23 11:53:28', NULL),
(1472, 'Finalizado', '2024-02-23 11:55:40', 605, 14, 'Em visita realizada no dia 19/02 foi identificado que 9 computadores não estavam ligando depois de uma sobrecarga de energia. Ao realizar os testes foi diagnosticado que 7/9 computadores estavam com a fonte de alimentação queimada e seria preciso a substituição. Os outros dois computadores apenas desconfigurou a ordem do boot e foram novamente configurados.\r\nAs peças necessárias foram adquiridas e devidamente instaladas. \r\nInicio do atendimento: 13:08\r\nTérmino do atendimento: 18:36.', '2024-02-23 11:55:40', NULL),
(1473, 'Finalizado', '2024-02-23 11:56:31', 602, 131, 'O problema foi causado devido ao curto da fonte, feito a descarga da fonte ao retirar da tomada, aguardar alguns instantes e reconectar, o computador voltou a funcionar.', '2024-02-23 11:56:31', NULL),
(1474, 'Finalizado', '2024-02-23 11:59:40', 602, 131, 'Cabo de força folgado, desconectava ao mexer no computador. Feito a troca do cabo de força, computador voltou a normalidade.', '2024-02-23 11:59:40', NULL),
(1475, 'Finalizado', '2024-02-23 12:05:28', 601, 131, 'Funcionários estavam ligando o computador de maneira errada, o gabinete apresentava um botão parecido com o power que estava confundindo os funcionários. Foi passada a orientação correta.', '2024-02-23 12:05:28', NULL),
(1476, 'Finalizado', '2024-02-23 12:09:20', 560, 131, 'Feito atualização do Windows e operações básicas como limpeza de arquivos temporários, otimização de disco rígido e diminuição de programas que estavam configurados para inicializar junto com o sistema (principal causador). Após os procedimentos, o computador apresentaram melhor desempenho.', '2024-02-23 12:09:20', NULL),
(1477, 'Finalizado', '2024-02-23 12:09:28', 559, 131, 'Feito atualização do Windows e operações básicas como limpeza de arquivos temporários, otimização de disco rígido e diminuição de programas que estavam configurados para inicializar junto com o sistema (principal causador). Após os procedimentos, o computador apresentaram melhor desempenho.', '2024-02-23 12:09:28', NULL),
(1478, 'Em Atendimento', '2024-02-23 12:10:58', 622, 131, 'Inicializado as 12:10:58 hs. do dia 23-02-2024', '2024-02-23 12:10:58', NULL),
(1479, 'Finalizado', '2024-02-23 12:16:25', 616, 131, 'Foi feito a instalação dos certificados, o sistema não estava conseguindo reconhecer o arquivo, procedimento mais eficiente foi passado para a responsável pela máquina.', '2024-02-23 12:16:25', NULL),
(1480, 'Finalizado', '2024-02-23 12:53:10', 614, 14, 'Montagem de uma maquina para a sala do consultório 8. \r\nInstalação do pacote office e pdf', '2024-02-23 12:53:10', NULL),
(1481, 'Finalizado', '2024-02-23 12:54:10', 613, 14, 'Cabo de conexão estava folgado, apertado e internet voltou a funcionar', '2024-02-23 12:54:10', NULL),
