(1483, 'Finalizado', '2024-02-26 12:25:29', 622, 131, 'Foi feita a troca da fonte para que o problema fosse retificado. Após isso, o computador voltou a funcionar.', '2024-02-26 12:25:29', NULL),
(1484, 'Em Atendimento', '2024-02-27 10:06:12', 629, 14, 'Inicializado as 10:06:12 hs. do dia 27-02-2024', '2024-02-27 10:06:12', NULL),
(1485, 'Finalizado', '2024-02-27 10:49:33', 629, 14, 'Leitor e drivers estão instalados, porém, ao executar dentro do sistema Ecuro ele não reconhece.\r\nCliente orientado a abrir chamado com o pessoal do sistema para verificar o erro.', '2024-02-27 10:49:33', NULL),
