(1579, 'Finalizado', '2024-03-08 12:14:14', 607, 131, 'A máquina não estava com vírus, o google estava exibindo propagando na tela para patrocinar antivírus e isso deu a entender que o computador estava; em contra partida, o computador estava cheio de antivírus, para evitar o mal desempenho da máquina e que haja problemas futuros, foi retirado os antivírus que estavam instalados na máquina e deixado só o sistema de segurança do Windows.', '2024-03-08 12:14:14', NULL),
