(1589, 'Em Atendimento', '2024-03-12 14:36:56', 650, 14, 'Inicializado as 14:36:56 hs. do dia 12-03-2024', '2024-03-12 14:36:56', NULL),
(1590, 'Em Atendimento', '2024-03-12 16:20:45', 668, 14, 'Inicializado as 16:20:45 hs. do dia 12-03-2024', '2024-03-12 16:20:45', NULL),
(1591, 'Finalizado', '2024-03-12 16:22:28', 668, 14, 'Ao chegar na instituição, foi feita uma revisão geral sobre os ramais que estavam funcionando ou não. Os números de duas linhas apresentavam problemas, sempre, ao ligar, chamavam, porém as ligações permaneciam mudas.\r\nO técnico da Vivo foi chamado e ficou ciente do problema, assim, um reset foi feito como solução. Após o reset os números voltaram a funcionar normalmente, contudo, ao fazermos os testes novamente, o problema persistiu. Então, fizemos a troca dos conectores dos ramais na tentativa de normalizar, uma vez que, com os testes do técnicos da vivo, chegamos a conclusão de que o problema não estava na central, mas no compartilhamento de linha. Feito a troca, os números retornaram a funcionar sem problema algum.\r\nRealizado testes de funcionamento junto com a aux da clinica.', '2024-03-12 16:22:28', NULL),
(1592, 'Em Atendimento', '2024-03-13 09:55:17', 666, 131, 'Inicializado as 09:55:17 hs. do dia 13-03-2024', '2024-03-13 09:55:17', NULL),
(1593, 'Finalizado', '2024-03-13 09:56:15', 666, 131, 'O problema estava sendo causado por poeira na memória e no slot da placa, ao fazer a limpeza desses equipamentos, o computador voltou a ser exibido na tela do monitor.', '2024-03-13 09:56:15', NULL),
(1594, 'Finalizado', '2024-03-13 09:57:56', 654, 131, 'O computador foi montado, como solicitado pela auxiliar (Emanuele) e está funcionando normalmente.', '2024-03-13 09:57:56', NULL),
(1595, 'Em Atendimento', '2024-03-13 14:51:17', 669, 14, 'Inicializado as 14:51:17 hs. do dia 13-03-2024', '2024-03-13 14:51:17', NULL),
(1596, 'Finalizado', '2024-03-13 15:29:47', 669, 14, 'Internet principal está off-line, colocado a internet de backup e internet voltou a funcionar na clinica.', '2024-03-13 15:29:47', NULL),
(1597, 'Em Atendimento', '2024-03-13 15:38:31', 671, 14, 'Inicializado as 15:38:31 hs. do dia 13-03-2024', '2024-03-13 15:38:31', NULL),
(1598, 'Finalizado', '2024-03-14 09:35:14', 671, 14, 'Colocado a internet de backup para funcionar. Orientado auxiliar como colocar a internet principal quando ela for restabelecida', '2024-03-14 09:35:14', NULL),
(1599, 'Em Atendimento', '2024-03-14 09:35:43', 670, 14, 'Inicializado as 09:35:43 hs. do dia 14-03-2024', '2024-03-14 09:35:43', NULL),
(1600, 'Em Atendimento', '2024-03-14 16:44:42', 663, 131, 'Inicializado as 16:44:42 hs. do dia 14-03-2024', '2024-03-14 16:44:42', NULL),
(1601, 'Finalizado', '2024-03-14 16:44:56', 663, 131, 'Ao chegar na unidade foi sinalizado cinco problemas:\r\nO primeiro problema foi relaciona a três e não dois computadores que estavam ruim. Um na recepção da orto, um na recepção principal, o consultório 17 e conectar os computadores da recepção orto na impressora e da recepção principal na impressora também.\r\nAssim foi feito, o computador da recepção principal estava ligando, porém não dando vídeo, fiz a limpeza na memória ram e o computador voltou a ligar.\r\nO computador da recepção orto, apresentava o mesmo problema, fiz a limpeza da memória ram e voltou a funcionar.\r\nO computador do Consultório 17 estava com o mesmo problema, a limpeza foi feita e voltou ao normal.\r\nApós, finalizado o procedimento, foi feita a conexão da impressora com o computador. Comecei pela recepção da orto, foi necessário baixar os drivers nas máquinas e colocar a impressora como padrão, feito isso, alguns testes foram realizados e aprovados pela recepcionista.\r\nA impressora da recepção principal, precisou realizar um compartilhamento da impressora com os demais computadores, nesse momento, foi pedido ajuda para Diego que executou o processo remotamente. Os testes foram feitos e aprovados pela auxiliar.\r\nO ultimo procedimento feito foi mudar o arquivo da digitação para PDF, pois estava como JNG. A mudança foi feita na hora de salvar, onde se pediu o formato do arquivo, testada e aprovada pela recepcionista.', '2024-03-14 16:44:56', NULL),
(1602, 'Pausado', '2024-03-14 17:39:04', 261, 131, 'Quando cheguei na unidade foram apresentado-me os seguintes problemas: Computador da recepção não liga; Computador do escritório não liga; Computador dos consultórios 08/09 não estava funcionando o teclado e nem o mouse.\r\nComeçando pelo escritório, fiz uma análise do problema e consegui notar que a máquina ligava, mas não dava vídeo. Abri o computador para dar uma olhada e vi que o computador estava com os slot\'s e memórias sujos, fiz a limpeza dos componentes citados e testei a máquina. Ela voltou a dar vídeo.\r\nPartindo para o Consultório 08/09, percebi que o pendrive (o teclado e mouse eram via bluethoot) não era compatível com o telcado e o mouse, então, procurei saber da auxiliar onde estava o pendrive correto, ela não soube dizer, lembrei que no computador dela havia dois pendrives, um para o telcado e outro para o mouse, tirei um para fazer os testes e nada deu certo.\r\nAlguns funcionários falaram-me de teclados que estavam guardados na recepção de cima, fui olhar e lá estava três teclados. Fiz os testes e não deram certos, suspeitei das pilhas e solicitei a troca para a auxiliar, ela comprou e, quando conectei, funcionou.\r\nFui até a sala dela e tinha outro teclado lá, fiz os teste de conexão com os que tinha e funcionou com um teclado que estava comigo. Acabara de encontrar um par.\r\nEsse par, deixei conectado no computada da auxiliar, agora só falta um mouse para completar o par do teclado. Infelizmente não encontrei o mouse, necessitando, assim, adquirir um.\r\nO terceiro computador estava com a fonte queimada, eu e a auxiliar fomos atrás de loja de informática para adquirir a fonte. Sem resultado.\r\nA fonte será solicitada para Priscila.\r\nNessa ínterim, foi solicitado o cadastro do leitor biométrico, orientei a auxiliar para abrir chamado no MovieDesk para que os leitores fossem cadastrados no Ecuro, assim a fez. E foi feita a instalação do AnyDesk nas máquinas.\r\n', '2024-03-14 17:39:04', NULL),
(1603, 'Em Atendimento', '2024-03-15 08:31:13', 592, 13, 'Inicializado as 08:31:13 hs. do dia 15-03-2024', '2024-03-15 08:31:13', NULL),
(1604, 'Finalizado', '2024-03-15 08:31:58', 592, 13, 'Devido o tempo que ja se passou não consegue mais verificar essa situação, pois as imagens não estão mais disponíveis.', '2024-03-15 08:31:58', NULL),
(1605, 'Em Atendimento', '2024-03-15 09:41:28', 624, 131, 'Inicializado as 09:41:28 hs. do dia 15-03-2024', '2024-03-15 09:41:28', NULL),
(1606, '', '2024-03-15 09:44:24', 0, 131, 'O problema em questão de tratava da memória ram que estava suja, devido a quantidade de poeira que estava presentes nos slots. Foi feita uma manutenção geral da placa, com troca de pasta térmica, limpeza da ventoinha e dos slot\'s. Após aguardar alguns instantes e reconectar os periféricos, o computador voltou a funcionar.', '2024-03-15 09:44:24', NULL),
(1607, 'Em Atendimento', '2024-03-15 09:47:06', 261, 131, 'Inicializado as 09:47:06 hs. do dia 15-03-2024', '2024-03-15 09:47:06', NULL),
(1608, 'Aguardando Comercial', '2024-03-15 09:51:31', 545, 131, 'Necessário acionar a equipe para analisar o problema da impressora e, se for necessário, fazer a retirada.', '2024-03-15 09:51:31', NULL),
(1609, 'Em Atendimento', '2024-03-15 09:53:49', 658, 15, 'Inicializado as 09:53:49 hs. do dia 15-03-2024', '2024-03-15 09:53:49', NULL),
(1610, 'Finalizado', '2024-03-15 09:54:21', 658, 15, 'Orientado a atualizar o app e o problema foi solucionado.', '2024-03-15 09:54:21', NULL),
(1611, 'Aguardando Cliente', '2024-03-15 09:56:47', 540, 131, 'A fonte chegou na unidade, entretanto,  o computador não se encontrava no local. Informaram-me que um doutor levar o computador e o leitor biométrico para o escritório da 16/22, contudo não foi recebido computador algum e leitor. Devido ao problema descrito acima, não foi possível realizar a instalação da fonte, a auxiliar mencionou que irá descobrir o paradeiro do computador e abrirá um novo chamado solicitando a instalação.', '2024-03-15 09:56:47', NULL),
(1612, 'Em Atendimento', '2024-03-15 09:57:18', 540, 131, 'Inicializado as 09:57:18 hs. do dia 15-03-2024', '2024-03-15 09:57:18', NULL),
(1613, 'Em Atendimento', '2024-03-15 10:00:15', 621, 131, 'Inicializado as 10:00:15 hs. do dia 15-03-2024', '2024-03-15 10:00:15', NULL),
(1614, 'Finalizado', '2024-03-15 10:05:17', 621, 131, 'A visita foi realizada e o problema analisado. A razão pelo qual o computador ia para a tela azul é que o Windows corrompeu, realizei a formatação do computador (O doutor autorizou) e, durante o processo, foi perceptível que o SSD estava zerado de GB, tanto livre como ocupado. Foi solicitado a Priscilla um SSD novo, até lá, consegui fazer com que esse SSD funcionasse, entretanto, nada que pode ser deixado a longo prazo.', '2024-03-15 10:05:17', NULL),
(1615, 'Em Atendimento', '2024-03-15 10:17:18', 678, 15, 'Inicializado as 10:17:18 hs. do dia 15-03-2024', '2024-03-15 10:17:18', NULL),
(1616, 'Aguardando Cliente', '2024-03-15 10:23:04', 678, 14, 'SSD da máquina queimado, solicitado a compra para a troca.', '2024-03-15 10:23:04', NULL),
(1617, 'Em Atendimento', '2024-03-15 10:29:16', 628, 131, 'Inicializado as 10:29:16 hs. do dia 15-03-2024', '2024-03-15 10:29:16', NULL),
(1618, 'Finalizado', '2024-03-15 10:29:24', 628, 131, 'A unidade estava com um computador da recepção que não estava conectando a internet - foi feita a troca do cabo de rede e voltou a funcionar.\r\nApresentava um computador que não dava imagem - limpeza da memória e dos slot\'s.\r\nFoi pedido para conectar os computadores da recepção na impressora - baixado os drivers e configurado como padrão.\r\nEm relação às tomadas, a auxiliar colocou uma fonte 110v em uma tomada 220v, as instruções foram passadas remotamente para ela com relação a troca de voltagens atrás da fonte.', '2024-03-15 10:29:24', NULL),
(1619, 'Em Atendimento', '2024-03-15 10:30:50', 647, 17, 'Inicializado as 10:30:50 hs. do dia 15-03-2024', '2024-03-15 10:30:50', NULL),
(1620, 'Finalizado', '2024-03-15 10:31:47', 647, 17, 'Entrei em contato com Tatiane, que atualmente está substituindo Carol, e foi informado que este problema do cpu radio já foi solucionado', '2024-03-15 10:31:47', NULL),
(1621, 'Em Atendimento', '2024-03-15 10:31:59', 646, 17, 'Inicializado as 10:31:59 hs. do dia 15-03-2024', '2024-03-15 10:31:59', NULL),
