(1640, 'Finalizado', '2024-03-15 13:56:53', 578, 131, 'Foi feita uma análise de casa computador e cheguei às seguintes conclusões sobee o relatório dos computadores parados em Sussuarana:\r\n\r\nComputadores do Consultório 10:\r\n\r\nComputador Recepção 04 - Kit upgrade + Fonte ATX Bivolts.\r\n\r\nComputador Recepção 06 - Kit Upgrade + Fonte ATX Bivolts.\r\n\r\nComputador Recepção 03 - Kit Upgrade + Fonte AtX Bivolts.\r\n\r\nComputador Recepção 08 - Kit Upgrade + Fone AtX Bivolts.\r\n\r\nComputador Sem Identificação - Fonte AtX + Memória 8GB.\r\n\r\nOBS.: Todos os computadores anteriores precisam de memória 8GB, porém, como o Kit Upgrade bem com tudo, não há necessidade de colocar. Kit Upgrade, já se entende que são todas as peças necessárias.\r\n\r\nAs peças já foram encaminhadas para Priscila.', '2024-03-15 13:56:53', NULL),
