(1720, 'Em Atendimento', '2024-03-19 15:20:22', 588, 131, 'Inicializado as 15:20:22 hs. do dia 19-03-2024', '2024-03-19 15:20:22', NULL),
(1721, 'Finalizado', '2024-03-19 15:20:28', 588, 131, 'Chegando na unidade, duas trocas foram feitas. Computador de um consultório para o outro e do consultório para recepção, juntamente com os telefones.\r\nAs máquinas foram montadas e aprovadas pela auxiliar.', '2024-03-19 15:20:28', NULL),
(1722, 'Finalizado', '2024-03-19 16:08:21', 622, 131, 'O computador não estava desligando toda hora, ele só não estava ligando devido a probemas no botão power do gabinete. Nas visitas anteriores, a troca do gabinete já havia sido feita, porém, o problema retornou.\r\nDevido a situção, a procura por um gabinete melhor foi iniciada, encontrando-a na sala ténica. Alguns testes foram feitos antes de iniciar a instalação da placa no novo gabinete, como tudo estava detro do esperado,a instalção foi executada. Já com o computador instalado, testei-o novamente e tudo voltou aos devidos conformes, estando tudo em ordem, pedi a validação da auxiliar que validou com sucesso.\r\n\r\nDurante a execução da solução anterior, Carine solicitou a instalação de um computador no Consultório Avaliação 02, na verdade, foi para saber se ele estava funcionando bem e assim o fiz, já finalizando as conexões das peças, liguei-o e estava funcionando bem, necessitando, apenas, de mouse, teclado, antena wifi e hamster biométrico, como era só para avaliar a máquina, não fiz questão de baixar os aplicativos básicos como Ecuro, office, etc. \r\nNovamente, Carine solicitou para que houvesse a mudança de dois computadores de lugar, mas antes de começar queria que fosse feita a instalação de um computador no consultório 3. Foi retirado uma máquina do Consultório 7 e retirado um mouse do Consultório 8 e levados para o 3. Com tudo em mãos, realizei a montagem.\r\nNessa ínterim, necessitou-se de um monitor, já que, outrora, pensou-se ser o cabo VGA o real problema. Em suma, realmente foi o VGA, logo após sua troca o monitor voltou a funcionar. Ao ligar, a máquina apresentava como S.O o Windows 7, devido ao seus sistema antigo, ele não estava reconhecendo os drivers e não eram possíveis fazer o download, uma vez que não havia antenas wifi para executar on-line. Surge a ideia de formatar o computador, deixado como último recurso, uma vez que os métodos executáveis não deram resultado. A permissão para formatar foi solicitado para a auxiliar que aprovou, então a formatação foi feita e o problema foi corrigido. Em suma, o computador está funcionando em questão de hardware, contudo, ficaria devendo só o pacote office. A auxiliar está ciente e disse que não haveria problema.\r\nRetomando para a mudança dos dois computadores, assim foi executado. Retirado o computador de um canto x\' e passado para um canto x\". Problemas pequenos foram surgindo e sendo solucionados. Vale ressaltar que, outrora, não sei se mencionado, a auxiliar pediu para dar uma olhada no Consultório 4, pois apresentava problemas de desempenho, esse em questão não foi olhado no momento em que estive na unidade, o motivo: a doutora estava em atendimento, contudo, devido as experiências tidas por quem digita, acredita ser memória ou uma limpeza rápida seja a solução, o que for que seja, será repassada para Priscila. \r\n', '2024-03-19 16:08:21', NULL),
(1723, 'Finalizado', '2024-03-19 16:09:02', 674, 131, 'Durante os processos feitos no chamado 622, olhei a máquina que estava com bloqueio no TeamViewer. Primeiro passo a ser feito foi olhar as configurações, realmente tinha algumas limitações e restrições de acesso, com toda cautela esses campos foram sendo desativados, nada que venha prejudicar o usuário ou a máquina. O TeamViewer apresentava-se desatualizado, isso também pode ter originado o problema de bloqueio. Enfim, foram feitos esses dois procedimentos (os únicos que deram para fazer) e solicitado um teste para a auxiliar (Carine), ela abriu um chamado para o suporte de cadastro do Ecuro e estamos no aguardo para saber o resultado dos nossos processos.', '2024-03-19 16:09:02', NULL),
(1724, 'Finalizado', '2024-03-19 17:36:52', 670, 14, 'Computador não dava vídeo devido a memoria está com muita sujeira. feito a limpeza corretiva e computador voltou a funcionar.', '2024-03-19 17:36:52', NULL),
