(1907, 'Finalizado', '2024-04-12 09:40:25', 751, 131, 'Situação do computador:\r\n   Após acessar a página do Ecuro, não carregava a interface: A tela ficava branca. Aparelho Ecuro não estava cadastrado no site. Solicitação para colocar corretor de digitalização.\r\nExecução: A ausência de interface no site do Ecuro foi causada pelo acúmulo de cache presente na página do Google Chrome, sendo assim, após realizar a limpeza de alguns caches da página, a interface retornou a aparecer.\r\nCom relação ao leitor biométrico - já descrito - o código gerado não estava cadastrado na página do Ecuro, portanto orientações foram passadas para que o problema seja solucionado, como abrir um chamado no MovieDesk para que o cadastro seja feito.\r\nAcessando as configurações do computador e Google, foi possível ativar a correção de digitalização.\r\nFinalizado todos os procedimentos, a validação da auxiliar foi feita e o atendimento encerrado.', '2024-04-12 09:40:25', NULL),
