(1955, 'Finalizado', '2024-04-17 10:45:15', 781, 131, 'Computadores da recepção conectados a impressora;\r\nComputador do Consultório 02; 01 e 04 conectados a impressora;\r\nDownload dos drives do leitor biométrico foram baixados e a auxiliar foi orientada a abrir cum chamado no moviedesk para cadastro no Ecuro;\r\nPacote office baixado no Computador do Consultório 08;\r\nComputador 4 da recepção apresenta defeito no cabo de força, foi orientado adquirir um novo, auxiliar disse que iria providenciar.\r\n ', '2024-04-17 10:45:15', NULL),
