(1957, 'Finalizado', '2024-04-17 10:49:08', 742, 131, 'Problema do notebook está na bateria, é necessário adquirir uma nova para corrigir o problema.\r\nSituação foi passada para auxiliar que disse que iria verificar se encontra uma bateria pela região, caso contrário irá informar-me para que a solicitação seja feita para Priscila.\r\nO notebook ficou funcionando direto na fonte só até a bateria chegar. Tendo isso, foi solicitado a troca de alguns computadores de lugar - serem levados para os seus respectivos lugares - assim foi feito.\r\nComputador da recepção apresentava problema na fonte, como já havia uma na mochila a substituição foi feita e o computador voltou a funcionar normalmente.', '2024-04-17 10:49:08', NULL),
