(2018, 'Finalizado', '2024-04-26 12:51:32', 808, 131, 'Computador da recepção com problema no cabo VGA e no sistema operacional, foi necessário realizar a restauração do S.O e a troca do cabo VGA, após isso, feito a clonagem do HD para o SSD, para melhorar o desempenho. (SSD já estava na máquina) Tudo funcionando normalmente.\r\nComputador da Avaliação 01 estava ligando, porém não dava vídeo, limpeza na memória solucionou o problema.\r\nComputador da recepção com falha na internet, é problema na clipagem. Foi feito uma clipagem nova e o problema foi solucionado.\r\nComputador da avaliação 04 estava com problema na inicialização do Windows, foi aproveitado o HD que estava no computador da recepção para que a doutora possa realizar atendimentos até que fosse recuperado o equipamento com o S.O.\r\nConclusão: Todos os computadores funcionando.\r\nSobre os computadores parados, já foi diagnósticados e peças já solicitadas para Priscila, aguardando adquirir.', '2024-04-26 12:51:32', NULL),
