(2020, 'Finalizado', '2024-04-26 12:56:14', 660, 131, 'Peças adquiridas e já instaladas nos locais designados.\r\nVale ressaltar que foi instalada, também, uma fonte nova que chegou no computador da prótese, pois a fonte demonstrava instabilidade, como o destino final dela - que seria o consultório 10 - já havia normalizado, relatado pela própria doutora, não houve a necessidade de realizar a instalação.', '2024-04-26 12:56:14', NULL),
