(2044, 'Finalizado', '2024-05-06 00:41:00', 761, 131, 'Foi solicitado a troca do HD e a formatação, pois não estava sendo possível realizar a retirada do Raio-x, a imagem saia pela metade.\r\nAo entrar em contato com o técnico da paronâmica, foi dito que era necessário diminuir a versão do Windows. Após isso, a imagem voltou ao normal.\r\nO SSD não foi utilizado, por isso, guardaram caso fosse necessário.', '2024-05-06 00:41:00', NULL),
