(2048, 'Finalizado', '2024-05-06 00:46:11', 753, 131, 'Computador da avaliação 1 não estava com a tela ruim, mas o computador apresentava problemas ao iniciar.\r\nCom analise feita, foi possível notar que o cabo de força estava estourado e a porta de conexão da fonte estava enferrujada. Nova peça solicitada para Priscila.\r\nComputador da recepção estava conectado na internet, mas estava reiniciando com frequência, como já tinha uma fonte na mochila, ela foi colocada nesse computador e o problema foi resolvido.', '2024-05-06 00:46:11', NULL),
