(2083, 'Finalizado', '2024-05-09 14:19:17', 762, 131, '\r\nDetalhes do Chamado nº: 761\r\nListar Anexar Imagem Erro\r\nEmpresa:\r\nVAMOS SORRIR BOCA DO RIO\r\nEquipamento:\r\nRecepção terreo - Número de Série: 1\r\nTipo:\r\nPresencial\r\nSolicitante:\r\nEvellen\r\nStatus Atual:\r\nFinalizado\r\nData:\r\n06/05/2024 00:40:57\r\nAbertura :\r\n10/04/2024 13:06:17\r\nConclusão:\r\nDuração:\r\nProblema :\r\nBoa tarde, solicito técnico para formata computador de panorâmica e trocar HD\r\nHistóricos do Chamado\r\nStatus	Data	Históricos\r\nAguardando Comercial	12/04/2024 09:51:32	Necessário visita técnica.\r\nEm Atendimento	12/04/2024 09:51:48	Inicializado as 09:51:48 hs. do dia 12-04-2024\r\nFinalizado	06/05/2024 00:41:00	Foi solicitado a troca do HD e a formatação, pois não estava sendo possível realizar a retirada do Raio-x, a imagem saia pela metade. Ao entrar em contato com o técnico da paronâmica, foi dito que era necessário diminuir a versão do Windows. Após isso, a imagem voltou ao normal. O SSD não foi utilizado, por isso, guardaram caso fosse necessário.', '2024-05-09 14:19:17', NULL),
(2084, 'Em Atendimento', '2024-05-09 14:30:48', 838, 131, 'Inicializado as 14:30:48 hs. do dia 09-05-2024', '2024-05-09 14:30:48', NULL),
(2085, 'Finalizado', '2024-05-09 14:30:53', 838, 131, 'O computador apresentava problema no cooler do processador. A ventoinha não estava funcionando, isso fazia com que a máquina ficasse lenta.\r\nFoi realizado uma limpeza na placa e a substituição do cooler por um que não estava utilizando. (Estava no consultório 10).\r\nTroca de pasta térmica e limpeza na memória RAM, limpeza da cache do computador e chrome.\r\nApós o procedimento a máquina voltou à normalidade.\r\nProcedimento validado pela recepcionista.', '2024-05-09 14:30:53', NULL),
(2086, 'Em Atendimento', '2024-05-10 08:12:51', 859, 15, 'Inicializado as 08:12:51 hs. do dia 10-05-2024', '2024-05-10 08:12:51', NULL),
