(2286, 'Pausado', '2024-05-21 08:41:35', 802, 131, 'Dia 1\r\n\r\n 	No primeiro dia de trabalho em relação a sala do CRC foi realizado uma análise de como seria feita a passagem de cabos para a sala do consultório 4 (futuro CRC) e o consultório 3. Percebemos que acima do gesso existia uma parede de concreto sem passagem para os cabos, juntamente com o pouco cabeamento que foi fornecido e a ausência de switch. Como não iriamos quebrar a parede para passar o cabo de rede, solicitamos canaletes que seria onde os cabos iriam passar.\r\nCom tudo anotado e estudado, a situação foi passada para Priscila, Diego, Cris e Dr.Felipe.\r\nAproveitamos para atender alguns chamados que estavam abertos.\r\n\r\nDia 2\r\n	Os materiais chegaram na unidade, foram testados (switch), contados se vieram certos e fomos realizar a passagem dos cabos. Conseguimos passar os cabos de redes para a sala do CRC. Contudo, era necessário perfurar alguns pontos estratégicos para que o cabo de rede chegasse ao computador, assim foi feito algumas marcações que seria para o eletricista fazer os furos quando ele fosse instalar uma tomada na sala.\r\n\r\nDia 3\r\n	Conseguimos passar os cabos e colocar os pontos de conexões para o acesso a rede com os canaletes.\r\nPorém, alguns problemas surgiram no final do expediente, são eles:\r\n1. As tomadas de alguns consultórios não estão funcionando, incluindo a tomada que o eletricista colocou para conectarmos o Switch;\r\n2. O RJ45 fêmea de um dos pontos de internet está com problema, na verdade, não sabemos se é o RJ45 ou o cabo. Precisamos de outro para colocarmos esse ponto de internet para funcionar.\r\nO resto está tudo tranquilo, a configuração que fizemos ficou muito boa, vamos precisar de uma dupla face para prender as caixinhas na parede.\r\nEm suma, teremos que voltar para lá para analisarmos se o problema é o cabo ou o RJ45 fêmea.\r\nO problema das tomadas das tomadas já foi passado para auxiliar.\r\nOBS.: Após uma queda de energia que teve em algumas luminárias da unidade, a luminária do Consultório 4 (Futuro CRC) não quis mais ligar. Situação repassada para Cris e a situação das tomadas também.\r\n', '2024-05-21 08:41:35', NULL),
