(2353, 'Finalizado', '2024-05-23 15:54:58', 926, 17, 'Foi realizado o acesso remoto para verificação dos erros relatados, passando todas as atualizações que ocorreram durante a ausência da Sra. Andreza, durante o acesso validei batidas que estavam alocadas no dia incorreto, e informei que estavam daquela forma por conta da data do relógio estar incorreta, onde a mesma estava com data do mês de Abril, sendo que eram batidas de Maio, informei que ocorreu após ter sido realizado o desbloqueio do relógio.\r\nAlém disso foi realizado uma atualização do sistema, para a versão mais recente, passando a informação pra Andreza, e informando que a partir de agora o CPF será uma informação obrigatória no cadastro de novos colaboradores. e que já poderia ir preenchendo dos atuais funcionários.\r\nFoi constatado que em alguns relógios estavam deixando lacunas com faltas de batidas, tendo em vista o que foi passado e que após uma nova coleta, os registros apareceram normalmente, tudo indica ser uma oscilação de rede no momento da coleta, o que pode trazer um TIME OUT que interrompe um certo momento a coleta das batidas, e volta depois de determinado dia, como passado, foi ajustado na configuração e coletado novamente, e não apresentou problemas.\r\nPara finalizar, como o sistema foi atualizado, foi criado um novo atalho na máquina de Andreza (No acesso remoto do servidor), e outra no acesso remoto de Mydiã, conforme foi solicitado, e criei um login separado para Mydiã conseguir acessar o sistema com o próprio usuário.', '2024-05-23 15:54:58', NULL),
(2354, 'Em Atendimento', '2024-05-23 22:37:45', 865, 271, 'Inicializado as 22:37:45 hs. do dia 23-05-2024', '2024-05-23 22:37:45', NULL),
(2355, 'Finalizado', '2024-05-23 22:37:52', 865, 271, 'Foi feita a restauração dos drivers de impressora para o scanner funcionar adequadamente.\r\nO procedimento foi testado e aprovado pela auxiliar.', '2024-05-23 22:37:52', NULL),
(2356, 'Em Atendimento', '2024-05-24 10:21:16', 933, 271, 'Inicializado as 10:21:16 hs. do dia 24-05-2024', '2024-05-24 10:21:16', NULL),
(2357, 'Aguardando Cliente', '2024-05-24 10:21:27', 933, 271, 'Os computadores foram montados, no entanto, eles estavam ligando e desligando. Após testar as máquinas, descobri que o problema era a placa-mãe.\r\nTestes realizados em computadores incluem a substituição da bateria cr2032, troca das memórias RAM e testes em seus respectivos slots, troca da fonte de alimentação, troca do processador, testes nas portas traseiras da placa, limpeza geral do computador, troca e limpeza dos cabos SATA e teste com o f_painel.', '2024-05-24 10:21:27', NULL),
