(2443, 'Finalizado', '2024-05-28 09:48:10', 642, 131, 'Foi colocada as antenas nos computadores designados. \r\nProblema de internet no AP estava associada ao cabo de rede, voltou a funcionar após clipa-lo novamente.\r\nPeça solicitada não chegou na unidade para melhoria da internet.\r\nProblema de lentidão da internet estava realacionada ao roteador do fornecedor, uma das portas está danificada, a auxiliar foi orientada à entrar em contato com o fornecedor para realizar a troca do aparelho, enquanto isso, deixamos a internet conectada em uma porta que está boa. Fizemos os testes e estava chegando os 80 megas que a clínica está pagando. Vale ressaltar que, na porta danificada, estavam chegando menos que 20 megas, além de ter um switch desnecessário que diminuia ainda mais a quantidade de megas enviados. (O switch foi removido)\r\nAnalisamos os computadores da recepção que irão precisar de SSD e memórias, ressaltando que o computador da recepção do segundo andar precisará de uma kit upgrade.\r\nUm computador da recepção precisou passar por uma restauração, pois a auxiliar questionou falha ao tentar instalar o Whatsapp. Ele reportava problemas na atualização do Windows, ao tentar atualizar, o Windows não permitia.\r\nEnviado os pedidos dessa peças, assim que estiverem na unidade, será agendada o retorno da visita para conclusão\r\n', '2024-05-28 09:48:10', NULL),
(2444, 'Em Atendimento', '2024-05-28 09:48:54', 642, 131, 'Inicializado as 09:48:54 hs. do dia 28-05-2024', '2024-05-28 09:48:54', NULL),
