(2675, 'Pausado', '2024-06-13 16:01:43', 1042, 131, 'Após entrar em contato com a Mobit, ela abriu um chamado para o fornecedor da linha para corrigir o problema. Mobit informou que o agente solucionador entrará em contato, para passar as informações da visita do técnico e acompanhamento sobre a tratativa.', '2024-06-13 16:01:43', NULL),
