(2719, 'Finalizado', '2024-06-17 15:27:48', 1054, 131, 'Problema se tratava da falta de atualização no aparelho biométrico. Após a atualização, o leitor adquiriu um código de registro (o mesmo) e voltou a funcionar.\r\nProcedimento aprovado, validado e acompanhado pela auxiliar.', '2024-06-17 15:27:48', NULL),
(2720, 'Em Atendimento', '2024-06-17 15:30:12', 940, 131, 'Inicializado as 15:30:12 hs. do dia 17-06-2024', '2024-06-17 15:30:12', NULL),
(2721, 'Finalizado', '2024-06-17 15:32:05', 940, 131, 'Em conversa com a auxiliar, ela informou que o doutor deixou de reclamar do computador lento. Após muitas tentativas de solucionar o problema, o doutor não se mostrava interessado, segundo a auxiliar. Questionei se poderia fechar o chamado, ela aprovou. Então, assim está sendo feito.\r\nConclusão: Devido a falta de posição do doutor, é entendido que o problema foi solucionado.', '2024-06-17 15:32:05', NULL),
(2722, 'Pausado', '2024-06-17 16:41:12', 1042, 131, 'Mobit entrou em contato perguntando se o problema havia sido solucionado, questionei para a auxiliar que informou a permanencia do problema. Informações repassada para Mobit.\r\nApós algumas horas, foi informado que o problema seria tentado resolver remotamente com prazo de 24h, caso não seja possível solucionar, será realizado uma visita e as informações sobre o dia será repassada.', '2024-06-17 16:41:12', NULL),
(2723, 'Em Atendimento', '2024-06-18 08:16:44', 1056, 17, 'Inicializado as 08:16:44 hs. do dia 18-06-2024', '2024-06-18 08:16:44', NULL),
(2724, 'Em Atendimento', '2024-06-18 08:21:09', 1055, 15, 'Inicializado as 08:21:09 hs. do dia 18-06-2024', '2024-06-18 08:21:09', NULL),
