(2726, 'Finalizado', '2024-06-18 08:25:36', 1052, 271, 'Já possui chamado para a máquina.', '2024-06-18 08:25:36', NULL),
(2727, 'Finalizado', '2024-06-18 08:46:50', 1056, 17, 'A colaboradora estava com carga horária de 8 horas no período em que estava com carga reduzida, alterei para o horário de 5 horas de carga, dentro do período de 02/05 a 31/05, e a folha fechou corretamente de acordo com os registros e conforme foi solicitado', '2024-06-18 08:46:50', NULL),
(2728, 'Finalizado', '2024-06-18 08:47:56', 1056, 17, 'Jamile saiu de férias  e Taiane que estará gerindo o ponto até o retorno de Jamile.', '2024-06-18 08:47:56', NULL),
(2729, 'Finalizado', '2024-06-18 10:06:42', 1055, 15, 'Renovação Realizada.', '2024-06-18 10:06:42', NULL),
(2730, 'Em Atendimento', '2024-06-18 10:15:19', 989, 271, 'Inicializado as 10:15:19 hs. do dia 18-06-2024', '2024-06-18 10:15:19', NULL),
(2731, 'Pausado', '2024-06-18 10:17:14', 989, 271, 'Foi feita a troca do SSD, porém ficou pendente a fonte do computador.\r\nAo realizar a clonagem do sistema, por algum motivo o computador perdeu a conexão com a máquina de raio-x. Foi acionado o suporte para que o problema seja resolvido. ', '2024-06-18 10:17:14', NULL),
