(2735, 'Finalizado', '2024-06-18 12:13:26', 1058, 271, 'Foi feita a ativação do Windows e excluído outro modelo de Office. Estava havendo um conflito entre os programas.', '2024-06-18 12:13:26', NULL),
(2736, 'Em Atendimento', '2024-06-18 13:04:48', 1036, 271, 'Inicializado as 13:04:48 hs. do dia 18-06-2024', '2024-06-18 13:04:48', NULL),
