(2756, 'Pausado', '2024-06-19 16:41:52', 1061, 131, 'Após entrar em contato com a auxiliar, foi possível notar a ausência do programa das câmeras no computador do escritório. Ao questionar se o computador havia sido trocado, ela informou que sim, pedi-lhe, então, que encontrasse a máquina que possuia o programa e ela não encontrou.\r\nSerá necessário baixar novamente o sistema das câmeras, assim como, realizar as configurações de acesso para conseguir acessar as filmagens desejadas.\r\nAuxiliar precisou ausentar-se. Aguardando o retorno dela para darmos continuidade ao atendimento.', '2024-06-19 16:41:52', NULL),
(2757, 'Pausado', '2024-06-20 10:32:47', 1061, 131, 'Atualização sobre a situação de Alagoinhas:\r\n\r\nFeita a instalação do aplicativo das câmeras, contudo a senha para conectar ao DVR, a nova auxiliar, não possui. Ela foi perguntar aos funcionários se a antiga auxiliar tinha a senha de conexão e as funcionárias disseram que não.\r\n\r\nConclusão: É necessário configurar o DVR no aplicativo das câmeras e fazer o reset da senha do DVR para ter o acesso. Em suma, precisará resolver presencialmente.', '2024-06-20 10:32:47', NULL),
