(2851, 'Finalizado', '2024-06-28 14:50:37', 1099, 15, 'Na verificação constatei que não estava contabilizando pois chegou na data final do banco de horas então Orientei sobre como funciona o banco de horas no sistema e como definir um novo periódo.', '2024-06-28 14:50:37', NULL),
(2852, 'Em Atendimento', '2024-06-28 16:36:29', 1100, 15, 'Inicializado as 16:36:29 hs. do dia 28-06-2024', '2024-06-28 16:36:29', NULL),
