(2854, 'Finalizado', '2024-06-28 17:13:39', 1097, 271, 'O computador fez uma restauração após uma queda de energia e foi feita a configuração dos programas e restauração dos arquivos. Sendo assim o computador voltou a funcionar normalmente. Foi avisado a responsável que precisa abrir um chamado no movidesk para configurar o leitor no ecuro. ', '2024-06-28 17:13:39', NULL),
(2855, 'Em Atendimento', '2024-06-28 23:17:34', 1068, 131, 'Inicializado as 23:17:34 hs. do dia 28-06-2024', '2024-06-28 23:17:34', NULL),
(2856, 'Finalizado', '2024-06-28 23:17:54', 1062, 131, 'Ao chegar no local, o computador apresentava conexão com a internet.', '2024-06-28 23:17:54', NULL),
(2857, 'Em Atendimento', '2024-06-28 23:20:55', 1062, 131, 'Inicializado as 23:20:55 hs. do dia 28-06-2024', '2024-06-28 23:20:55', NULL),
(2858, 'Finalizado', '2024-06-28 23:21:00', 1064, 131, 'Foi conectado um computador da recepção na impressora e feita a instalação do escâner.\r\nO segundo computador da recepção (computador da ponta, próximo ao switch) não foi possível conectar o escâner, mas está imprimindo.\r\nOs testes foram feitos e executados com sucesso. Como a recepcionista avisou que não teria problema deixar um computador sem escanear e avisou-me que chegaria um novo computador, foi deixado um computador só imprimindo.', '2024-06-28 23:21:00', NULL),
(2859, 'Finalizado', '2024-06-28 23:26:12', 1064, 131, 'Técnico foi ao local para acompanhar o processo de passagem de cabeamento, contudo, o rapaz que irá executar o procedimento não compareceu. Um vídeo explicando os locais de ponte de internet e telefonia foi enviado para Priscila, assim ele terá uma base de como deve ser feito a passagem.\r\nAs peças que chegaram na unidade foram: 2 Switch 8 portas; 1 switch 24 portas e uma caixa com cabo de rede de 305m. As outras peças estavam sendo providenciadas por Priscila.\r\nFoi instalada um switch de 8 portas no controle da prótese e 1 switch de 24 portas no escritório, o outro switch de 8 portas não foi possível instalar, pois falta ponto de energia no local que irá ficar. Isso será solicitado para Priscila.', '2024-06-28 23:26:12', NULL),
(2860, 'Pausado', '2024-06-28 23:26:44', 1021, 131, 'Técnico foi ao local para acompanhar o processo de passagem de cabeamento, contudo, o rapaz que irá executar o procedimento não compareceu. Um vídeo explicando os locais de ponte de internet e telefonia foi enviado para Priscila, assim ele terá uma base de como deve ser feito a passagem. As peças que chegaram na unidade foram: 2 Switch 8 portas; 1 switch 24 portas e uma caixa com cabo de rede de 305m. As outras peças estavam sendo providenciadas por Priscila. Foi instalada um switch de 8 portas no controle da prótese e 1 switch de 24 portas no escritório, o outro switch de 8 portas não foi possível instalar, pois falta ponto de energia no local que irá ficar. Isso será solicitado para Priscila.', '2024-06-28 23:26:44', NULL),
