(2941, 'Finalizado', '2024-07-04 12:06:31', 1130, 17, 'Funcionária estava com PIS incorreto no relógio, orientei a realizar a correção da informação, e alterei o AFD, pra puxar os registros mais antigos e importar no sistema, além disso estava com o horário pré assinalado, e a funcionária registra almoço, criei um novo horário, sem pré assinalado configurado, e aloquei para esta funcionária, e informei os colaboradores que registrarem hora de almoço, precisa trocar para o novo horário criado, para não divergir o ponto', '2024-07-04 12:06:31', NULL),
