(3197, 'Em Atendimento', '2024-07-16 09:02:37', 945, 271, 'Inicializado as 09:02:37 hs. do dia 16-07-2024', '2024-07-16 09:02:37', NULL),
(3198, 'Finalizado', '2024-07-16 09:06:10', 945, 271, 'Foi feita a limpeza em grande parte dos computadores, exceto o computador do escritório e panorâmico. \r\nFoi notado que os computadores não tinham nenhum dispositivo de segurança (no mesmo dia houve duas quedas de energia), a informação foi passada para a auxiliar e médico responsável. Vale lembrar que os computadores na sua maioria estavam com vírus e vários programas inutilizados (tem que ser feito o acesso remoto para remoção). ', '2024-07-16 09:06:10', NULL),
(3199, 'Finalizado', '2024-07-16 09:06:10', 945, 271, 'Foi feita a limpeza em grande parte dos computadores, exceto o computador do escritório e panorâmico. \r\nFoi notado que os computadores não tinham nenhum dispositivo de segurança (no mesmo dia houve duas quedas de energia), a informação foi passada para a auxiliar e médico responsável. Vale lembrar que os computadores na sua maioria estavam com vírus e vários programas inutilizados (tem que ser feito o acesso remoto para remoção). ', '2024-07-16 09:06:10', NULL),
(3200, 'Aguardando Cliente', '2024-07-16 09:07:20', 1136, 14, 'Passado a orientação para a responsavel das auxiliares, Sr° Aline. Encaminmhado\r\n vídeo de orientação de como alterar o email e telefone de recuperação dos emails das auxiliares e das clinicas. Após a troca dos mesmo, serei notificado da conclusão. ', '2024-07-16 09:07:20', NULL),
(3201, 'Em Atendimento', '2024-07-16 09:10:07', 701, 14, 'Inicializado as 09:10:07 hs. do dia 16-07-2024', '2024-07-16 09:10:07', NULL),
(3202, 'Finalizado', '2024-07-16 09:10:43', 701, 14, 'Reparo realizado pela operadora e telefones voltaram a funcionar corretamente.', '2024-07-16 09:10:43', NULL),
(3203, 'Em Atendimento', '2024-07-16 09:18:48', 1226, 131, 'Inicializado as 09:18:48 hs. do dia 16-07-2024', '2024-07-16 09:18:48', NULL),
