(3205, 'Finalizado', '2024-07-16 09:31:03', 1232, 17, 'Durante o atendimento, foi confirmado que não seria a reinstalação do sistema de ponto em si, e sim a instalação do Web Service do relógio, fiz o acesso remoto, e utilizei do IP Scanner, para identificar o ip alocado ao relógio, e acessei e liberei novamente o web service no computador, deixei um atalho criado para fácil acesso para gerarem os AFDs.', '2024-07-16 09:31:03', NULL),
(3206, 'Em Atendimento', '2024-07-16 10:46:47', 1198, 131, 'Inicializado as 10:46:47 hs. do dia 16-07-2024', '2024-07-16 10:46:47', NULL),
(3207, 'Em Atendimento', '2024-07-16 11:08:15', 1210, 271, 'Inicializado as 11:08:15 hs. do dia 16-07-2024', '2024-07-16 11:08:15', NULL),
(3208, 'Aguardando Cliente', '2024-07-16 11:09:40', 1210, 271, 'Ao chegar no consultório 23, foi verificado não tinha cabo de força e por isso o computador não ligada. \r\nFalta também o leitor e o adaptador Wi-Fi para funcionamento perfeito da máquina. ', '2024-07-16 11:09:40', NULL),
(3209, 'Em Atendimento', '2024-07-16 11:26:35', 1237, 17, 'Inicializado as 11:26:35 hs. do dia 16-07-2024', '2024-07-16 11:26:35', NULL),
(3210, 'Finalizado', '2024-07-16 11:27:38', 1237, 17, 'Cadastrei uma nova justificativa, de atestado de acompanhamento conforme solicitado, e orientei ao cliente, a como fazer futuros cadastros de novas justificativas quando necessário.', '2024-07-16 11:27:38', NULL),
(3211, 'Em Atendimento', '2024-07-16 11:37:31', 1236, 17, 'Inicializado as 11:37:31 hs. do dia 16-07-2024', '2024-07-16 11:37:31', NULL),
(3212, 'Finalizado', '2024-07-16 11:38:57', 1236, 17, 'Foi alterado o usuário antigo de Daniella Barbosa, informado que a mesma não trabalha mais na empresa, para José Vieira, sob nº de CPF: 116.671.154-48. Realizado o processo conforme solicitado e orientação de como navegar entre os diferentes bancos de dados, da DP PNEUS E LIDER ALAGOAS.', '2024-07-16 11:38:57', NULL),
(3213, 'Em Atendimento', '2024-07-16 11:39:04', 1212, 131, 'Inicializado as 11:39:04 hs. do dia 16-07-2024', '2024-07-16 11:39:04', NULL),
(3214, 'Finalizado', '2024-07-16 11:40:13', 1212, 131, 'Após entrar em contato com a auxiliar, ela informou que o técnico já havia atendido. \r\nEla foi orientada a abrir um chamado no MoviDesk para que o cadastro do leitor biométrico seja feito.', '2024-07-16 11:40:13', NULL),
(3215, 'Em Atendimento', '2024-07-16 11:42:22', 1214, 131, 'Inicializado as 11:42:22 hs. do dia 16-07-2024', '2024-07-16 11:42:22', NULL),
(3216, 'Pausado', '2024-07-16 11:42:57', 1214, 131, 'O computador parou de funcionar. Atendimento será continuado após o conserto da máquina.', '2024-07-16 11:42:57', NULL),
(3217, 'Em Atendimento', '2024-07-16 12:09:07', 1238, 271, 'Inicializado as 12:09:07 hs. do dia 16-07-2024', '2024-07-16 12:09:07', NULL),
(3218, 'Aguardando Cliente', '2024-07-16 12:13:30', 1238, 271, 'Ao chegar no consultório 23 notamos que a maquina estava sem o cabo de força e consequentemente não conseguia ligar, ao informar a auxiliar administrativa informou que tem uma maquina na recepção do orto inativa que poderia utilizar as peças e com a autorização pegamos a maquina e utilizamos o cabo de força para o funcionamento de maquina no consultório 23, mas para total funcionamento seria necessário adaptador wi-fi, estabilizador e leitor digital.', '2024-07-16 12:13:30', NULL),
(3219, 'Aguardando Comercial', '2024-07-16 12:16:47', 1138, 271, 'Ao chegar no local a impressora não estava funcionando e ao analisar era um papel atolado que impedia as impressões, foi retirado o papel e testamos, a impressora está funcionando normalmente', '2024-07-16 12:16:47', NULL),
