(3238, 'Finalizado', '2024-07-16 16:51:53', 952, 17, 'Sistema foi reinstalado e registrado com êxito, foi instalado novamente no servidor do local, e criei um atalho pra máquina da cliente, o  último backup havia sido realizado em 02/04/2024, restaurei, e através de um AFD, coletei todos os últimos registros que houveram no relógio. Atualmente o mesmo se encontra fora de internet, informei a cliente que seria necessário verificar o cabeamento, pra o conectar novamente, e conseguir puxar as informações através do sistema, a mesma informou que estará verificando com o TI, por conta disso, orientei a como puxar as informações via pen drive, e como cadastrar novo colaborador via teclado, pelo fato de ser um relógio antigo.', '2024-07-16 16:51:53', NULL),
(3239, 'Pausado', '2024-07-16 16:52:43', 1166, 17, 'Entrei em contato com o cliente, porém não obtive resposta.', '2024-07-16 16:52:43', NULL),
