(3241, 'Finalizado', '2024-07-16 16:54:07', 1169, 271, 'A impressora estava com papel atolado e por isso não estava imprimindo. Após retirar o papel voltou a imprimir. ', '2024-07-16 16:54:07', NULL),
(3242, 'Em Atendimento', '2024-07-16 16:55:09', 1137, 271, 'Inicializado as 16:55:09 hs. do dia 16-07-2024', '2024-07-16 16:55:09', NULL),
(3243, 'Finalizado', '2024-07-16 16:55:41', 1137, 271, 'Chamado repetido, já foi solucionado o problema em questão com um reset na impressora. ', '2024-07-16 16:55:41', NULL),
(3244, 'Pausado', '2024-07-16 17:06:06', 1242, 17, 'O usuário em questão estava sem nenhuma restrição, para corrigir, incluir somente para este usuário os colaboradores de sua obra, CONS SÃO DESIDÉRIO, após isso o mesmo afirmou que tinha ficado ok, porém que alguns colaboradores haviam sumido do relógio, informei que possivelmente teria que cadastrar novamente, já que no sistema não apresenta nada que pode ter ocorrido para esta situação, estou aguardando retorno pra certificar de que ficou tudo ok no sistema e no relógio, ainda não tive outra resposta\r\n', '2024-07-16 17:06:06', NULL),
