(3251, 'Pausado', '2024-07-17 09:45:55', 1021, 131, 'Os cabeamentos foram passados por nós da RepBrasil. Foi colocado pontos de internet e telefone nos locais solicitado. Os pontos de internet estão funcionando e já estão com computador conectados, já os pontos de telefone precisam ser configurados. Um dia será marcado por Diego, juntamente com outro técnica, para que seja finalizado a parte de telefonia.', '2024-07-17 09:45:55', NULL),
(3252, 'Em Atendimento', '2024-07-17 10:26:07', 1018, 271, 'Inicializado as 10:26:07 hs. do dia 17-07-2024', '2024-07-17 10:26:07', NULL),
(3253, 'Finalizado', '2024-07-17 10:28:34', 1019, 271, 'Foi realizado a verificação dos leitores e computador. Foi informado a auxiliar e ao doutor do consultório que quando houvesse esse travamento realizasse o reinício da máquina. \r\nVale lembrar que computador utiliza um kit antigo, ideal realizar a troca para perfeito funcionamento. ', '2024-07-17 10:28:34', NULL),
