(3255, 'Aguardando Outros', '2024-07-17 10:32:38', 1018, 271, 'Foi solicitado a retirada da impressora para a resolução do problema. A auxiliar informou que estava recarregando o toner, informei a mesma que poderia causar problema como esse ou até mesmo a quebra geral da máquina. \r\nA auxiliar informou que verá a possibilidade de compra dos toners. ', '2024-07-17 10:32:38', NULL),
