(3526, 'Finalizado', '2024-08-01 09:22:57', 1333, 17, 'Foi verificado no o relatório passado e foi feito um acesso remoto para verificação das situações passadas.\r\n\r\n\r\nDia 02/07 - Não havia problema na escala, bastava apagar os registros e reimportar, e já alocou corretamente.\r\n\r\n\r\n08/07 - Na escala esse dia está lançado como folga, ocasionando na situação em que registrou e não puxou intervalo e ao mesmo tempo gerou extra pro dia inteiro, foi orientado a retirar a folga e lançar novamente.\r\n\r\n\r\ndia 12/07 e 13/07 - o registro de saída do funcionário estava caindo no dia 13/07, pois o horário cadastrado não estava configurado com o fechamento correto, conforme foi orientado, é o que segue padronizado nos outros horários. Atualizando o fechamento do horário, o registro alocou corretamente.\r\n\r\n\r\ndia 15/07 - Neste dia o funcionário estava sem escala definida, puxando o horário pré-definido da escala, que seria das 17:00 as 01:00 e descanso de 19:30 a 20:30, neste dia ele trabalhou no horário de 09:00 as 17:00, pelo fato de não ter sido definido este horário na escala, ele alocou com o intervalo conflitante com a jornada do dia.\r\n\r\n\r\nRealizando as correções dos problemas descritos acima, a folha de cálculos deste funcionário foi normalizada.', '2024-08-01 09:22:57', NULL),
