(3844, 'Finalizado', '2024-08-13 16:44:21', 1452, 17, 'O AFD está sendo gerado corretamente, porém os colaboradores que o cliente desejava importar os registros, estavam registrando o ponto hoje no relógio da outra obra, expliquei que o rapaz do outro local precisaria gerar o arquivo e enviar ou importar ele mesmo no sistema, no relógio mencionado no chamado, somente o cliente que realizou a abertura bateu ponto, realizei a importação, e o registro subiu pro ponto dele perfeitamente.', '2024-08-13 16:44:21', NULL),
(3845, 'Em Atendimento', '2024-08-13 17:01:24', 1444, 17, 'Inicializado as 17:01:24 hs. do dia 13-08-2024', '2024-08-13 17:01:24', NULL),
(3846, 'Finalizado', '2024-08-13 17:01:30', 1444, 17, 'Informei a cliente que não tinha como realizar reconhecimento facial sem estar conectado a internet, e que no caso de estar sem conexão, estar optando por utilizar o teclado. Cliente informou que um dos tablets estava com defeito, e que estaria levando para consertar, já o outro, seguiu as orientações e o conectou a internet, fazendo isso, pessoal voltou a registrar o ponto sem nenhum problema.', '2024-08-13 17:01:30', NULL),
