(4164, '', '2024-08-23 16:39:32', 1511, 322, 'A Mobit entrou em contato e passou a seguinte mensagem:\r\n\r\nOlá, boa tarde!\r\nMe chamo Matheus, e faço parte da Mobit Soluções.\r\n\r\nConforme solicitado vide chamado n°2024080735 , seu reparo técnico foi agendado e o técnico deve comparecer na unidade na data e hora abaixo:\r\n\r\nData: Entra dia 23/08 e 01/09\r\nHora: 8:00 às 18:00\r\nEndereço informado: Rua Floriano Peixoto, 122, Casa, Centro, Conceição do Coité - BA, 48730-000\r\nOperadora: Oi\r\n\r\nEm contato com a operadora, fomos informados que o tipo de tecnologia Cobre que é a utilizada na linha 7532621220, foi descontinuada e a operadora não presta mais serviço de reparo para esse tipo de tecnologia, o agendamento que conseguimos foi por exceção com a Ouvidoria. A mesma repassou que no momento não tem viabilidade para outro tipo de tecnologia de linha fixa no endereço, dessa forma, a orientação seria realizar a portabilidade para uma operadora que atenda esse tipo de tecnologia e consiga dar suporte ou também em outra operadora trocar para uma tecnologia que tenha suporte.\r\n\r\nQualquer dúvida estamos à disposição!????\r\n\r\nAtenciosamente,\r\nGestão Link | Mobit Soluções.\r\n', '2024-08-23 16:39:32', NULL),
